import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import axios from 'axios';

const Dashboard = () => {

  const navigate = useNavigate();
  const [getState,setState] = useState({
    productName:'',
    price:''
  })

  const onChangeHandler=(event)=>{
    setState({...getState,[event.target.name]:event.target.value})
  }

  const onSubmitDetails=(event)=>{
    event.preventDefault();
    if(!getState.productName || !getState.price){
      alert("Details are mandatory");
    }
    axios.post('http://localhost:8080/api/product/create',getState).then(()=>{
         alert("successfully data added");
    }).catch((err)=>{

    })

  }

  // useEffect(()=>{
  //   if(!sessionStorage.getItem('token')){
  //     alert("user data is not found");
  //     navigate('/login');
  //   }
  // },[])

  return (<div>
    <h1 style={{textAlign:'center'}}>Welcome to Dashboard</h1>
    <div className="container">
      <div className="col-4">

      </div>
      <div className="col-4">
        <form>
          <div class="form-group">
            <label htmlFor="productName">Product Name</label>
            <input type="text" className="form-control"  onChange={onChangeHandler} id="productName" name="productName"/>
          </div>
          <div class="form-group">
            <label for="price">Price</label>
            <input type="number" class="form-control" onChange={onChangeHandler} id="price"  name="price"/>
          </div>
          <button  onClick={onSubmitDetails} type="submit" class="btn btn-primary">Add</button>
        </form>
      </div>
      <div className="col-4">

      </div>
    </div>
    <div className="container">
      <div className="col-1">

      </div>
      <div className="col-10">
      <table class="table table-dark">
  <thead>
    <tr>
      <th scope="col">#</th>
      <th scope="col">First</th>
      <th scope="col">Last</th>
      <th scope="col">Handle</th>
    </tr>
  </thead>
  <tbody>
    <tr>
      <th scope="row">1</th>
      <td>Mark</td>
      <td>Otto</td>
      <td>@mdo</td>
    </tr>
    <tr>
      <th scope="row">2</th>
      <td>Jacob</td>
      <td>Thornton</td>
      <td>@fat</td>
    </tr>
    <tr>
      <th scope="row">3</th>
      <td>Larry</td>
      <td>the Bird</td>
      <td>@twitter</td>
    </tr>
  </tbody>
</table>
        </div>
        <div className="col-1">

        </div>
    </div>
  </div>)
}
export default Dashboard;
